  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Pocasse NWR outlines
  Refuge accomplishments from January through April of 1963. The report begins by
  summarizing the weather conditions, habitat conditions, water conditions, and food
  and cover during this period. Wildlife- including migratory birds, upland game birds,
  big game animals, furbearers, predators, rodents, mammals, raptors, and fish- is
  also covered. The Refuge development and maintenance section discusses physical
  developments. The public relations section of the report describes recreational
  uses, Refuge visitors, Refuge participation, and hunting. Items of interest and
  N-R forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
